    </blockquote>
    <h2 {...{
      "id": "installing-with-pip"
    }}>{`Installing with pip`}</h2>
    <p>{`To install the Palo Alto Networks Cloud Python SDK, run this command in
your terminal:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`pip install pancloud
`}</code></pre>
