        "href": "http://docs.python-guide.org/en/latest/starting/installation/"
      }}>{`Python
installation
guide`}</a>{`
can guide you through the process.`}</p>
    <h2 {...{
      "id": "installing-with-pipenv"
    }}>{`Installing with pipenv`}</h2>
    <p>{`To install the Palo Alto Networks Cloud Python SDK using
`}<a parentName="p" {...{
        "href": "https://docs.pipenv.org/"
      }}>{`pipenv`}</a>{`, start by creating a virtualenv:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`pipenv install
`}</code></pre>
    <p>{`You can optionally specify which python version to use in your
virtualenv using the following:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`pipenv --three install
`}</code></pre>
    <p>{`or`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`pipenv --two install
`}</code></pre>
