    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`git clone git://github.com/PaloAltoNetworks/pancloud
`}</code></pre>
    <p>{`Or download the
`}<a parentName="p" {...{
        "href": "https://github.com/PaloAltoNetworks/pancloud/tarball/master"
      }}>{`tarball`}</a>{`:`}</p>
